
package com.eurekaoptimus.sample

import kotlinx.coroutines.*
import kotlin.system.measureNanoTime
import kotlin.system.measureTimeMillis

class PalindromeAsync {

    companion object {
        suspend fun find(input: String):  String {
            //val result = mutableListOf<Deferred<String>>()
            if ( input.isPalindrome()) return input
            return runBlocking {
                val deferredResult = async (context = Dispatchers.Default ) {
                    println("  Even find      : I'm working in thread ${Thread.currentThread().name}")
                    var longest = input.substring(0, 1)
                    for (i in 1..input.length) {
                        var left = i
                        var right = i
                        while (left > 0 && right < input.length && input[left] == input[right]) {
                            if (right - left + 1 > longest.length) {
                                longest = input.substring(left, right + 1)
                            }
                            left--
                            right++
                        }
                    }

                    longest.trim()
                }
                val deferredOddResult = async (context = Dispatchers.Default ) {
                    println("  Odd find       : I'm working in thread ${Thread.currentThread().name}")
                    var longest = input.substring(0, 1)
                    for (i in 1..input.length) {
                        var left = i
                        var right = i + 1
                        while (left > 0 && right < input.length && input[left] == input[right]) {
                            if (right - left + 1 > longest.length) {
                                longest = input.substring(left, right + 1)
                            }
                            left--
                            right++
                        }
                    }
                    longest.trim()
                }
                var even = ""
                var odd = ""

                val result = awaitAll(async {
                   measureNanoTime {
                        even = deferredResult.await()
                    }
                },
                async {
                    measureNanoTime {
                        odd = deferredOddResult.await()
                    }
                })

                println("Even: $even (${even.length}) Odd: $odd (${odd.length}) Duration ${(result[0] / 1000.0).toFloat()} ${(result[1]/1000.0).toFloat()} ")
                if ( even.length > odd.length ) even else odd
            }
        }
    }
}

fun List<String>.findLongestString(): String {
    return this.maxByOrNull { it.length } ?: ""
}
