// DSL
fun String.isPalindrome() : Boolean  {
    if ( this.length <= 1 ) return false
    for ( i in 0..this.length/2 ){
        if ( this[i] != this[this.length-i-1]){
            return false
        }
    }
    //println("Palindrome found $this")
    return true
}


fun main (){
    //test()
